INSERT INTO `aboutuses` (`id`, `about_us_desc`, `header`, `description`, `about_us_image`, `created_at`, `updated_at`) VALUES
(1, 'Hillside Memorial Garden in Lumbangan, Zamboanga City is a beautiful and serene place to lay your loved ones to rest. We offer a variety of burial options, including mausoleums, crypts, and niches. We also offer perpetual care, so you can be sure that your loved one\'s grave will always be well-maintained.', 'Hillside Memorial Garden is a trusted and compassionate provider of funeral and cemetery services.', 'We are committed to providing our families with the highest quality of care and support during their time of need.\n    \n                                                We offers a range of burial options, including spacious mausoleums, dignified crypts, and affordable niches, catering to the diverse needs of families.\n                                                \n                                                We provide various cremation services, including urn selection and engraving, offering families flexibility in honoring their loved ones. We are known for our beautiful hillside location with stunning views, unique burial options like mausoleums, crypts, and niches, perpetual care to maintain gravesites indefinitely, and a dedicated, compassionate staff to guide families through the process.', 'aboutus_img.jpg', NULL, '2023-11-14 22:41:37');
INSERT INTO `carousels` (`id`, `image`, `header`, `description`, `created_at`, `updated_at`) VALUES
(5, 'carousel3.jpg', 'Welcome to Hillside Memorial Garden', 'We are committed to provide your family the highest quality care and service in your time of need, and we take pride in our responsibility to lighten your burden as you take the first step toward healing', '2023-11-14 22:15:39', '2023-11-14 22:15:39'),
(6, 'carousel1.jpg', 'Beautiful Scenery', 'Located on a hillside overlooking the city, offering stunning views of the surrounding area. This can provide comfort and peace to family and friends who visit the gravesite', '2023-11-14 22:16:16', '2023-11-14 22:16:16'),
(7, 'carousel4.jpg', 'Perpetual Care', 'Hillside Memorial Garden offers perpetual care, which means that the cemetery will take care of the gravesite in perpetuity. This gives families peace of mind knowing that their loved one\'s grave will always be well-maintained', '2023-11-14 22:16:43', '2023-11-14 22:16:43');
INSERT INTO `logos` (`id`, `logo_name`, `email`, `contact`, `logo_desc`, `logo_image`, `created_at`, `updated_at`) VALUES
(1, 'Hillside Memorial Garden', 'hillsidememorialgardeninc@yahoo.com', '09663261147', 'You know everyone wants a piece of land. It\'s the only investment that will never depreciate.', 'Hillside_logo.png', NULL, '2023-11-14 22:46:09');
