INSERT INTO `policies` (`id`, `policy_name`, `policy_desc`, `created_at`, `updated_at`) VALUES
(3, '72 Hours Policy', 'Client must notify the company for any interment at least seventy-two (72) hours prior to the scheduled interment. Likewise, the necessary interment fee and required payments for the lot/s shall be paid. The company reserves the right to reschedule, postpone, delay or deny interment depending on capacity to inter or availability of personnel and equipment.', '2023-11-14 22:42:10', '2023-11-17 09:07:52'),
(4, 'Required Document', 'Required documents / permits shall be submitted at least forty-eight (48) hours before any interment services are rendered.', '2023-11-14 22:42:27', '2023-11-14 22:42:27'),
(5, 'Burial Permit', 'Burial Permit/Tax required by law shall be on the account and responsibility of the client. In no case shall interment be allowed without the necessary burial permit. (No Burial Permit, No Interment)', '2023-11-14 22:42:43', '2023-11-14 22:42:43'),
(6, 'Lawn Lots', 'Lawn lots and Mausoleum lots must be fully paid before interment will be scheduled.', '2023-11-14 22:42:58', '2023-11-14 22:42:58'),
(7, 'Interment Schedule', 'Change of interment schedule and cancellation of interment shall be subjected to applicable fees.', '2023-11-14 22:43:14', '2023-11-14 22:43:14'),
(8, 'Interment Services', 'Interment services shall be rendered solely and exclusively by HillSide and/or its authorized contractor.', '2023-11-14 22:43:34', '2023-11-14 22:43:34'),
(9, 'Fee Inclusions', 'Interment fee shall include the cost of concrete vault, grave digging, flat marble marker with engraving and basic interment setup.', '2023-11-14 22:43:48', '2023-11-14 22:43:48'),
(10, 'Interment Fees', 'Interment fee shall vary in amount depending on the nature of interment services to be rendered.', '2023-11-14 22:44:01', '2023-11-14 22:44:01'),
(11, 'Required Document', 'Required documents / permits shall be submitted at least forty-eight (48) hours before any interment services are rendered.', '2023-11-14 22:44:14', '2023-11-14 22:44:14'),
(12, 'Additional Service and Logistics', 'Additional service and logistics on top of the basic interment setup shall be charged to the client.', '2023-11-14 22:44:35', '2023-11-14 22:44:35'),
(13, 'No Interment on Dates', 'There will be no interment services on January 1, Maundy Thursday, Good Friday, Black Saturday, October 31, November 1, November 2, December 24-26 and December 31.', '2023-11-14 22:44:54', '2023-11-14 22:44:54');
